import { Component } from '@angular/core';

@Component({
  selector: 'app-list-autoevaluacion',
  templateUrl: './list-autoevaluacion.component.html',
  styleUrls: ['./list-autoevaluacion.component.css']
})
export class ListAutoevaluacionComponent {

}
<app-navbar></app-navbar>
<h4>mostrar info de los Usuarios a los que se les puede realizar la autoevaluacion</h4>

<button routerLink="atoevaluacion/item/{{1}}" type="button" class="btn btn-primary btn-sm ms-2">agregar</button>
